<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Crazy Arp Tab</title>
  <link href="https://fonts.googleapis.com/css2?family=Roboto:wght@400;500&display=swap" rel="stylesheet">
  <link rel="stylesheet" href="arp-style.css">

  <style>
    * {
      font-family: 'Roboto', sans-serif;
      box-sizing: border-box;
      padding: 0px;
      margin: 0px;
    }

    html,
    body {
      padding: 0;
      margin: 0;
      width: 100vw;
      background: transparent;
    }

    body {
      position: relative;
    }

    .title {
      position: sticky;
      top: 0px;
      left: 0px;
      width: 100%;
      border-bottom: 2px solid rgba(83, 83, 83, 0.753);
      padding: 5px 5px 20px 15px;
      margin: 0px;
      color: rgba(255, 255, 255, 0.897);
      box-shadow: 0px 5px 5px 1px rgba(95, 95, 95, 0.575);
      background: rgb(44, 117, 146);
      /* border-radius: 5px 0px 0px 5px; */
    }

    .tab-text {
      transition: 0.3s;
      fill: rgb(26, 26, 26);
      /* box-shadow: 0px 0px 10px 1px rgb(0, 0, 0); */
      stroke-width: 0.15;
      cursor: pointer;
      font-weight: 500;
      stroke: rgba(87, 87, 87, 0.924);
      transition: 0.5s ease;
      z-index: 5;
      position: absolute;
    }

    .tab-text:hover {
      fill: rgb(255, 255, 255);
      transition: 0.5s;
      font-weight: 500;
      stroke-width: 0.5;
      stroke: #2f2f2fdc;

      transform: scale(1.05);
      fill: rgb(255, 255, 255);
      transition: 0.5s;
      font-weight: 700;
      font-size: 28px;
      stroke-width: 0.95;
      stroke: #2f2f2fab;
    }

    .tab-text:active {
      /* transform: rotate(720deg); */
      fill: rgb(29, 29, 29);
      transition: 0.5s;
      font-weight: 700;
      font-size: 28px;
      stroke-width: 0.95;
      stroke: #e9e9e9ab;
    }

    .title {
      /* margin: 5px 15px; */
      font-size: 1.5em;
      font-weight: 700;
      letter-spacing: 3px;

    }

    .staffer {}

    .tab-container {
      height: 100vh;
      width: 100vw;
      margin: auto;
      overflow: auto;
    }
  </style>
</head>
